import React from "react";
import Icon from "./Icon";

const Alert = ({ props }) => {
    return (


    <div className={`col-sm-12 alert alert-${props.alertType}`}>
            <div className="row">
                <div className="col-sm-1">
                    <Icon/>
                </div>
            </div>
    </div>


    );
};

export default Alert;
